import React from "react";

class HeaderComponent extends React.Component {
    render() {
        return(
            <header>
                <div>
                    <ul>
                        <li>메뉴1</li>
                        <li>메뉴2</li>
                        <li>메뉴3</li>
                    </ul>
                </div>
            </header>
        );
    };
}

export default HeaderComponent;
